import React, { Component } from "react";
import Project from "./project";

class Projects extends Component {
  constructor() {
    super();
    this.state = {
      projectList: []
    };
  }

  componentDidMount() {
    fetch("http://127.0.0.1:5000/", {
      method: 'get',
      headers: {
        "Token": "eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9.eyJpc3MiOiJpb2V0LmNvbSIsInN1YiI6ImFuZHJlcyIsInJvbGUiOiJhZG1pbiIsImV4cCI6MTUzOTIwNjMwNH0.1bqzKBDjEalrBWgSM0oK1hbBp9ROce58eBuWEVqmbqw",
        'Content-Type': 'application/json',
        mode: "cors",
      }
    })
      .then(results => {
        console.log(results)
        return results.json();
      })
      .then(data => {
        console.log(data);
        this.setState({ projectList: data.results });
      }).catch(err => {
        console.log(err)
      });
  }

  render() {
    return <Project projectList={this.state.projectList} />;
  }
}

export default Projects;
